import React from "react";
import data from "./data";

function Card(params) {
    return(
        <>
          <h3> welcome to cards </h3>
          <p> {data.map((value)=>{
              return(
                  <>
                     <div>
                         <h3> {value.student_name} </h3>
                         <h3> {value.college} </h3>
                         <h3> {value.class} </h3>
                         <h3> {value.marks} </h3>
                         <img src= {value.Image} />
                     </div>
                  </>
              );
          })} </p>
        </>
    );
}

export default Card;
